import React from 'react'
import { Button, Col } from 'react-bootstrap';

export default function User(props) {
  const { data:{firstName, lastName, title,picture} } = props;
  const str= `${title} ${firstName} ${lastName}`;
  return (
    <Col xs={{ span: 10, offset: 1 }} sm={{ span: 8, offset: 2 }} md={{ span: 5, offset:1 }} lg={{ span: 4, offset:0 }} >
      <div className='User'>
        <img src={picture} alt="No-image" width="100px" height="100px" />
        <div className='info'>
          <span > {str}</span>
          <Button variant='outline-primary'>Add friend</Button>
        </div>
      </div>
    </Col>
  )
}
